import { Outlet,Link } from "react-router-dom";
import { Fragment } from "react";

const Navigation = () => {
    return (
      <Fragment>
        <div className="navigation">
         <div>
            LOGO
         </div>
         <div className="links-container">
            <Link className="nav-link" to='/shop'>SHOP</Link>
         </div>
        </div>
        <Outlet/>
      </Fragment>
    );
  };
  export default Navigation;
